import mongoose from 'mongoose'

const Sp = mongoose.Schema({
_name: {
        type: String,
        required: true
    },
_image: {
        type: String,
        required: true
    },
    participants: {
        type: Array
    }
})

export default mongoose.model('Sports', Sport)
